import { useEffect } from 'react';
import './App.css';

function App() {

  const [data, setData] = useState({});
  useEffect(()=>{
    fetch("http://localhost:5000/getData").then((res) => res.json()).then((d)=> setData(d));
  },[])
  return (
    <div className="App">
      <header className="App-header">

      </header>
      {JSON.stringify(data) !== '{}'? console.log(data) : <p>Loading....</p>}
      {JSON.stringify(data) !== '{}'? data.map((f)=>(<img src={f.assets[0].gameAbsolutePath}></img>)): <p>Loading....</p>}
      {/*JSON.stringify(data) !== '{}'? data.vocabTerms.map((f) => (
          <p> {f.name} : {f.description}</p>
      )): <p>Loading...</p>*/}
    </div>
  );
}

export default App;
